export default function HeaderLeft() {
  return (
    <>
      <div className="header-left">
        <div id="logo">
          <a href="/">
            <img
              src="/logo.png"
              title="logo"
              alt="logo"
              className="img-responsive"
            />
          </a>
        </div>
      </div>
      <style jsx>{`
        .header-left {
          float: left;
          width: auto;
        }
      `}</style>
    </>
  );
}
